import React from "react";
import "./css/App.css";
import { Routes, Route, Switch } from "react-router-dom";
import Home from "./pages/Home";
import Callback from "./pages/Callback";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/callback" element={<Callback />} />
      </Routes>
    </>
  );
}

export default App;
